SQL SECURITY INVOKER
VIEW view_countpostbymenuid
AS
SELECT
  `m`.`MenuID` AS `MenuID`,
  `m`.`Title` AS `Title`,
  `m`.`ParentID` AS `ParentID`,
  (SELECT
      COUNT(0)
    FROM `post` `p`
