  UPDATE library_card
  SET AccountID = v_AccountID -- AccountID - CHAR(36)
      ,
      CardCode = v_CardCode -- CardCode - VARCHAR(50) NOT NULL
      ,
      JoinDate = v_JoinDate -- JoinDate - TIMESTAMP
      ,
      ExpiredDate = v_ExpiredDate -- ExpiredDate - TIMESTAMP
      ,
      MemberType = v_MemberType -- MemberType - INT(11)
      ,
      TotalBookCheckedOut = v_TotalBookCheckedOut -- TotalBookCheckedOut - INT(11)
      ,
