--
-- Create function `Func_CountTotalQuantityInOrderInformation`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION Func_CountTotalQuantityInOrderInformation (OrderInformation longtext)
RETURNS int(11)
BEGIN
  DECLARE i int DEFAULT 0;
  DECLARE jCount int DEFAULT -1;
  DECLARE totalCount int DEFAULT 0;

  SET jCount = jCount + JSON_LENGTH(OrderInformation, '$');
  WHILE (i <= jCount) DO

    SET totalCount = totalCount + CAST(JSON_EXTRACT(OrderInformation, CONCAT('$[', i, '].quantity')) AS int);
    SET i = i + 1;

  END WHILE;

  RETURN totalCount;
END
$$

