('073408d7-2361-44c7-9da3-d3dd50c09990', '8d0fb05d-5ca6-4cf6-adfb-75e50d2a88c5', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'OpenDOAR - Danh mục các nguồn tin truy cập mở', 'opendoar-danh-muc-cac-nguon-tin-truy-cap-mo', 'Tính đến nay, OpenDOAR cung cấp gần 6000 tài liệu, phủ trên 09 lĩnh vực với 12 loại tài liệu, trong đó loại bài báo và luận văn, luận án chiến tỷ trọng cao nhất.', '"<p><strong>T&iacute;nh đến nay, OpenDOAR cung cấp gần 6000 t&agrave;i liệu, phủ tr&ecirc;n 09 lĩnh vực với 12 loại t&agrave;i liệu, trong đ&oacute; loại b&agrave;i b&aacute;o v&agrave; luận văn, luận &aacute;n chiến tỷ trọng cao nhất.</strong></p>\\n<p><a href=\\"https://lic.haui.edu.vn/vn/\\">Thư viện ĐH C&ocirc;ng nghiệp H&agrave; Nội</a>&nbsp;xin giới thiệu đến bạn đọc nguồn truy cập mở&nbsp;<a href=\\"https://v2.sherpa.ac.uk/opendoar/\\" target=\\"_blank\\" rel=\\"noopener\\">OpenDOAR</a>&nbsp;(Open Directory of Open Access Repositories): Danh mục nguồn tin truy cập mở l&agrave; một trang web c&oacute; trụ sở tại Vương quốc Anh, cung cấp danh s&aacute;ch to&agrave;n diện v&agrave; tin cậy c&aacute;c kho t&agrave;i liệu nội sinh truy cập mở học thuật của c&aacute;c trường đại học, viện nghi&ecirc;n cứu tr&ecirc;n to&agrave;n thế giới. C&aacute;c li&ecirc;n kết tới c&aacute;c kho số nội sinh được đ&aacute;nh gi&aacute; chất lượng trước khi đưa v&agrave;o danh mục n&ecirc;n c&oacute; gi&aacute; trị học thuật cao. OpenDOAR c&ograve;n liệt k&ecirc; v&agrave; cho ph&eacute;p người sử dụng t&igrave;m kiếm c&aacute;c kho số nội sinh theo chủ đề, ng&ocirc;n ngữ, dạng t&agrave;i liệu (như b&agrave;i nghi&ecirc;n cứu, kết quả nghi&ecirc;n cứu, s&aacute;ch, s&aacute;ng chế, luận &aacute;n) hoặc khu vực như Ch&acirc;u Phi, Ch&acirc;u &Aacute;, Australasia, Caribbean, Trung Mỹ, Ch&acirc;u &Acirc;u, Bắc Mỹ v&agrave; Nam Mỹ.</p>\\n<p>OpenDOAR được duy tr&igrave; bởi Đại học Nottingham dưới sự bảo trợ của SHERPA về c&aacute;c dịch vụ v&agrave; được triển khai v&agrave;o năm 2005 với sự hợp t&aacute;c của Đại học Lund. Dự &aacute;n được t&agrave;i trợ bởi Viện Khoa học Mở, Jisc, Hiệp hội c&aacute;c Thư viện Nghi&ecirc;n cứu (CURL) v&agrave; SPARC Ch&acirc;u &Acirc;u.</p>\\n<p>T&iacute;nh đến nay,&nbsp;<a href=\\"https://v2.sherpa.ac.uk/opendoar/\\" target=\\"_blank\\" rel=\\"noopener\\">OpenDOAR</a>&nbsp;cung cấp gần 6000 t&agrave;i liệu, phủ tr&ecirc;n 09 lĩnh vực với 12 loại t&agrave;i liệu, trong đ&oacute; loại b&agrave;i b&aacute;o v&agrave; luận văn, luận &aacute;n chiến tỷ trọng cao nhất.</p>\\n<p>Để truy cập v&agrave;o OpenDOAR, bạn đọc thực hiện như sau:</p>\\n<p>Bước 1: Truy cập v&agrave;o đường dẫn sau:&nbsp;<a href=\\"https://v2.sherpa.ac.uk/opendoar/\\" target=\\"_blank\\" rel=\\"noopener\\">https://v2.sherpa.ac.uk/opendoar/</a></p>\\n<p>Bước 2: Bấm v&agrave;o mục Directory</p>\\n<p>Bước 3: Nhập th&ocirc;ng tin cần t&igrave;m kiếm</p>\\n<p><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://images.unsplash.com/photo-1647873134223-e4c648d1456b?ixlib=rb-1.2.1&amp;ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&amp;auto=format&amp;fit=crop&amp;w=764&amp;q=80\\" alt=\\"\\" width=\\"auto\\" height=\\"auto\\" /></p>\\n<p>Tại đ&acirc;y c&oacute; hai chế độ t&igrave;m kiếm:&nbsp;<strong>T&igrave;m kiếm cơ bản</strong>&nbsp;v&agrave;&nbsp;<strong>T&igrave;m kiếm n&acirc;ng cao</strong>. Với chế độ t&igrave;m kiếm n&acirc;ng cao bạn đọc c&oacute; thể giới hạn, chỉ định c&aacute;c v&ugrave;ng t&igrave;m kiếm theo từng ti&ecirc;u ch&iacute;.</p>\\n<p style=\\"text-align: center;\\"><span style=\\"text-decoration: underline;\\"><span style=\\"color: #e03e2d;\\"><code>Hi my name is Hai</code></span></span></p>\\n<p>&nbsp;</p>\\n<p>&nbsp;</p>\\n<p style=\\"text-align: center;\\"><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://images.unsplash.com/photo-1649361635653-6c582209c7b1?ixlib=rb-1.2.1&amp;ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&amp;auto=format&amp;fit=crop&amp;w=688&amp;q=80\\" alt=\\"unplash\\" width=\\"688\\" height=\\"1031\\" /></p>\\n<blockquote>\\n<p style=\\"text-align: center;\\"><code><span style=\\"font-size: 10pt;\\">Hang pắc p&oacute;</span></code></p>\\n</blockquote>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Ft79747.jpg?alt=media&token=9f2dcfb3-3fe3-45f9-bddc-840d3004bf52', 200, 1, '2022-04-06 14:39:10', 'DOVANHAI', '2022-04-12 15:30:51', 'DOVANHAI', True, False),
('0c75a1e3-72e4-4e1c-8f19-e098b1767889', '8d0fb05d-5ca6-4cf6-adfb-75e50d2a88c5', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'tieu-de-bai-dang-mac-dinh', 'tieu-de-bai-dang-mac-dinh', 'Mô tả mặc định', '"<p>Đ&oacute;ng cửa thư viện&nbsp;</p>\\n<p><img title=\\"dai hoc cong nghiep.jpg\\" src=\\"data:image/jpeg;base64,\\" alt=\\"\\" width=\\"677\\" height=\\"381\\" /></p>"', '', 200, 1, '2022-06-11 09:40:13', 'đỗ văn hải', '2022-06-11 09:40:13', 'đỗ văn hải', True, True);
INSERT INTO post VALUES
('3457f492-dbd6-40e8-aadf-433591cce185', 'be71f925-721b-4892-9a39-c450ea8ea88d', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Về việc sử dụng các dịch vụ của Thư viện đối với sinh viên K62', 've-viec-su-dung-cac-dich-vu-cua-thu-vien-doi-voi-sinh-vien-k62', 'Các bạn tân sinh viên K62 có thể đến và sử dụng các dịch vụ của Thư viện bằng Chứng Minh Thư Nhân Dân hoặc...', '"<p>C&aacute;c bạn t&acirc;n sinh vi&ecirc;n K62 c&oacute; thể đến v&agrave; sử dụng c&aacute;c dịch vụ của Thư viện bằng Chứng Minh Thư Nh&acirc;n D&acirc;n hoặc Căn Cước C&ocirc;ng D&acirc;n để thay thế tạm thời cho thẻ sinh vi&ecirc;n trong thời gian chờ được cấp.</p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2F116A4885.jpg?alt=media&token=b2f44dae-166c-41e4-acce-a64f46025dc6', 200, 1, '2022-04-12 08:54:31', 'DOVANHAI', '2022-04-12 15:00:49', 'DOVANHAI', True, False),
('3d489c0b-97cf-4024-a724-a928377df7cc', '34426e66-99cc-409f-ab2f-da49e23002b7', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Học liệu mở', 'hoc-lieu-mo', 'Thư viện ĐH Công nghiệp Hà Nội xin giới thiệu tới Quý bạn đọc một số tài nguyên mở được bình duyệt, có chất lượng ...', '"<table style=\\"margin-left: auto; margin-right: auto; width: 100%;\\" border=\\"1\\" cellspacing=\\"2\\" cellpadding=\\"2\\">\\n<tbody>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://www.doaj.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76546.jpg\\" alt=\\"DOAJ - Directory of Open Access Journals\\" width=\\"292\\" height=\\"146\\" /></a></p>\\n<p><a href=\\"https://doaj.org/\\" target=\\"_blank\\" rel=\\"noopener\\">C&aacute;c tạp ch&iacute; truy cập mở</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\"><a href=\\"https://doaj.org/\\" target=\\"_blank\\" rel=\\"noopener\\">DOAJ</a>&nbsp;(Directory of Open Access Journals) l&agrave; địa chỉ trực tuyến chỉ mục v&agrave; cung cấp quyền truy cập tới c&aacute;c tạp ch&iacute; truy cập mở được b&igrave;nh duyệt, c&oacute; chất lượng cao.&nbsp;<a href=\\"https://doaj.org/\\" target=\\"_blank\\" rel=\\"noopener\\">DOAJ</a>&nbsp;được th&agrave;nh lập dưới sự bảo trợ của trường Đại học LUND (Thụy Điển), Thư viện Quốc gia Thụy Điển v&agrave; INASP (Mạng lưới quốc tế cho ph&eacute;p t&igrave;m kiếm c&aacute;c xuất bản phẩm khoa học).&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/khai-thac-danh-muc-tap-chi-mo-directory-of-open-access-journals-doaj/63486\\">(xem th&ecirc;m)</a></td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://oatd.org/\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76547.jpg\\" alt=\\"Open Access Theses and Dissertations\\" /></a></p>\\n<p><a href=\\"https://oatd.org/\\" target=\\"_blank\\" rel=\\"noopener\\">Luận văn truy cập mở</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">\\n<p class=\\"pBody\\">OATD.org (Open Access Theses and Dissertations) nhắm tới mục đ&iacute;ch trở th&agrave;nh nguồn t&agrave;i nguy&ecirc;n truy cập mở tốt nhất về việc t&igrave;m kiếm c&aacute;c luận văn v&agrave; luận &aacute;n tốt nghiệp ở mọi lĩnh vực. Th&ocirc;ng tin về c&aacute;c luận &aacute;n tr&ecirc;n OATD được thu thập từ hơn 1100 trường cao đẳng, đại học v&agrave; c&aacute;c tổ chức nghi&ecirc;n cứu tr&ecirc;n to&agrave;n thế giới.</p>\\n<p class=\\"pBody\\">OATD hiện đang lập chỉ mục 5.899.472 luận văn v&agrave; luận &aacute;n. Hầu hết c&aacute;c t&agrave;i liệu n&agrave;y đều sẵn s&agrave;ng để truy cập v&agrave; cho ph&eacute;p bạn tải xuống miễn ph&iacute; sử dụng cho mục đ&iacute;ch c&aacute; nh&acirc;n.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/tai-nguyen-luan-van-truy-cap-mo-oatd-org/64138\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://www.doabooks.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76548.jpg\\" alt=\\"The Directory of Open Access Books\\" /></a></p>\\n<p><a href=\\"https://www.doabooks.org/\\" target=\\"_blank\\" rel=\\"noopener\\">Danh mục s&aacute;ch truy cập mở</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">\\n<p class=\\"pBody\\">DOAB l&agrave; viết tắt cụm từ tiếng Anh của Directory of Open Access Books &ndash;Thư mục s&aacute;ch truy cập mở. DOAB l&agrave; dịch vụ của Quỹ OAPEN, đ&acirc;y l&agrave; s&aacute;ng kiến Quốc tế d&agrave;nh ri&ecirc;ng cho việc xuất bản s&aacute;ch chuy&ecirc;n khảo truy cập mở (Open Access).</p>\\n<p class=\\"pBody\\">Mục đ&iacute;ch ch&iacute;nh của DOAB l&agrave; tăng khả năng kh&aacute;m ph&aacute; của c&aacute;c s&aacute;ch truy cập mở. Truy cập v&agrave;o DOAB, bạn sẽ được truy cập hơn 43,887 s&aacute;ch chuy&ecirc;n khảo với nhiều lĩnh vực đến từ 658 nh&agrave; xuất bản, hầu hết to&agrave;n bộ s&aacute;ch tr&ecirc;n DOAB đều được r&agrave; so&aacute;t ngang h&agrave;ng theo ti&ecirc;u chuẩn h&agrave;n l&acirc;m.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/gioi-thieu-thu-muc-sach-truy-cap-mo-doab/64133\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p class=\\"pBody\\"><a href=\\"https://v2.sherpa.ac.uk/opendoar/\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76550.jpg\\" alt=\\"The Directory of Open Access Resources\\" /></a></p>\\n<p class=\\"pBody\\"><a href=\\"https://v2.sherpa.ac.uk/opendoar/\\">Danh mục c&aacute;c nguồn tin truy cập mở</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\"><a href=\\"https://v2.sherpa.ac.uk/opendoar/\\" target=\\"_blank\\" rel=\\"noopener\\">OpenDOAR</a>&nbsp;(Open Directory of Open Access Repositories): Danh mục nguồn tin truy cập mở l&agrave; một trang web c&oacute; trụ sở tại Vương quốc Anh, cung cấp danh s&aacute;ch to&agrave;n diện v&agrave; tin cậy c&aacute;c kho t&agrave;i liệu nội sinh truy cập mở học thuật của c&aacute;c trường đại học, viện nghi&ecirc;n cứu tr&ecirc;n to&agrave;n thế giới. C&aacute;c li&ecirc;n kết tới c&aacute;c kho số nội sinh được đ&aacute;nh gi&aacute; chất lượng trước khi đưa v&agrave;o danh mục n&ecirc;n c&oacute; gi&aacute; trị học thuật cao. OpenDOAR c&ograve;n liệt k&ecirc; v&agrave; cho ph&eacute;p người sử dụng t&igrave;m kiếm c&aacute;c kho số nội sinh theo chủ đề, ng&ocirc;n ngữ, dạng t&agrave;i liệu (như b&agrave;i nghi&ecirc;n cứu, kết quả nghi&ecirc;n cứu, s&aacute;ch, s&aacute;ng chế, luận &aacute;n) hoặc khu vực như Ch&acirc;u Phi, Ch&acirc;u &Aacute;, Australasia, Caribbean, Trung Mỹ, Ch&acirc;u &Acirc;u, Bắc Mỹ v&agrave; Nam Mỹ&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/opendoar-danh-muc-cac-nguon-tin-truy-cap-mo/64683\\">(xem th&ecirc;m)</a></td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"http://search.ndltd.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76558.jpg\\" alt=\\"Global Electronic Thesis and Dissertation Search\\" /></a></p>\\n<p><a href=\\"http://search.ndltd.org/\\" target=\\"_blank\\" rel=\\"noopener\\">T&igrave;m kiếm luận &aacute;n, luận văn to&agrave;n cầu</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">\\n<p><strong>Mạng thư viện số luận văn, luận &aacute;n quốc tế - NDLTD</strong>&nbsp;ra đời với sứ mệnh l&agrave; th&uacute;c đẩy sự phổ biến th&ocirc;ng tin khoa học (luận &aacute;n, luận văn) tr&ecirc;n to&agrave;n cầu. Hiện tại NDLTD c&oacute; hơn gần 100 trường đại học th&agrave;nh vi&ecirc;n từ Hoa Kỳ, Canada, Ấn Độ, Nhật Bản, Ph&aacute;p&hellip; với hơn 6.200.000 t&agrave;i liệu.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/ndltd-mang-thu-vien-so-luan-van-luan-an-quoc-te/64690\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://worldwidescience.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76559.jpg\\" alt=\\"WorldWideScience\\" /></a></p>\\n<p><a href=\\"https://worldwidescience.org/\\" target=\\"_blank\\" rel=\\"noopener\\">Cổng th&ocirc;ng tin khoa học to&agrave;n cầu</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"http://www.bioline.org.br/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76560.jpg\\" alt=\\"Bioline International\\" /></a></p>\\n<p><a href=\\"http://www.bioline.org.br/\\" target=\\"_blank\\" rel=\\"noopener\\">CSDL khoa học y học, sinh học, m&ocirc;i trường, bảo tồn</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://arxiv.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76561.jpg\\" alt=\\"ArXiv\\" /></a></p>\\n<p><a href=\\"https://arxiv.org/\\" target=\\"_blank\\" rel=\\"noopener\\">CSDL Khoa học to&aacute;n học, vật l&yacute;, khoa học m&aacute;y t&iacute;nh, sinh học</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">\\n<p class=\\"pBody\\">Được th&agrave;nh lập năm 1991, đến nay (2021) arXiv đ&atilde; tr&ograve;n 30 năm x&acirc;y dựng, ban đầu arXiv được ph&aacute;t triển bởi Paul Ginsparg, do Đại học Cornell tổ chức v&agrave; điều h&agrave;nh dưới h&igrave;nh thức như một kho lưu trữ cho c&aacute;c bản in trước c&aacute;c b&agrave;i b&aacute;o học thuật trong lĩnh vực Vật l&yacute;, sau đ&oacute; được mở rộng th&ecirc;m c&aacute;c lĩnh vực: To&aacute;n học, Khoa học m&aacute;y t&iacute;nh, Sinh học định lượng, T&agrave;i ch&iacute;nh định lượng, Thống k&ecirc;, Kỹ thuật điện, Khoa học hệ thống v&agrave; Kinh tế.</p>\\n<p class=\\"pBody\\">Truy cập v&agrave;o arXiv bạn sẽ c&oacute; cơ hội tiếp cận gần&nbsp;<strong>hai triệu b&agrave;i b&aacute;o học thuật trong 8 lĩnh vực</strong>&nbsp;tr&ecirc;n v&agrave; đặc biệt, c&aacute;c b&agrave;i b&aacute;o tr&ecirc;n cơ sở dữ liệu n&agrave;y c&oacute; thể&nbsp;<strong>đọc trực tuyến hoặc tải về miễn ph&iacute;</strong>&nbsp;ở định dạng .pdf hoặc c&aacute;c định dạng kh&aacute;c.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/tai-nguyen-mo-arxiv-voi-2-trieu-bai-bao-hoc-thuat/64137\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://books.google.com.vn/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76562.jpg\\" alt=\\"Google Books \\" /></a></p>\\n<p><a href=\\"https://books.google.com.vn/\\" target=\\"_blank\\" rel=\\"noopener\\">H&agrave;ng triệu cuốn s&aacute;ch được xuất bản tr&ecirc;n khắp thế giới</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"http://onlinebooks.library.upenn.edu/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76563.jpg\\" alt=\\"The Online Book Page\\" /></a></p>\\n<p><a href=\\"http://onlinebooks.library.upenn.edu/\\" target=\\"_blank\\" rel=\\"noopener\\">Miễn ph&iacute; hơn 1 triệu t&agrave;i liệu điện tử</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">\\n<p class=\\"pBody\\">The Online Books Page l&agrave; một trang web được th&agrave;nh lập v&agrave; bi&ecirc;n tập bởi John Mark Ockerbloom - một nh&agrave; nghi&ecirc;n cứu, ph&aacute;t triển thư viện số tại Đại học Pennsylvania,với mục đ&iacute;ch l&agrave; khuyến kh&iacute;ch sự ph&aacute;t triển của s&aacute;ch trực tuyến v&agrave; tạo điều kiện để người d&ugrave;ng truy cập v&agrave;o những cuốn s&aacute;ch c&oacute; thể đọc miễn ph&iacute; qua Internet.</p>\\n<p class=\\"pBody\\">Truy cập v&agrave;o&nbsp;<a href=\\"https://onlinebooks.library.upenn.edu/\\"><strong>The Online Books Page</strong></a>, bạn sẽ c&oacute; cơ hội tiếp cận với hơn 3 triệu s&aacute;ch điện tử miễn ph&iacute;, hầu hết ch&uacute;ng đều sẵn s&agrave;ng để tải xuống với c&aacute;c định dạng phổ biến như EPUB v&agrave; PDF.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/truy-cap-hang-trieu-sach-dien-tu-mien-phi-voi-the-online-books-page/64136\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://data.worldbank.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76564.jpg\\" alt=\\"World Bank\\" /></a></p>\\n<p><a href=\\"https://data.worldbank.org/\\" target=\\"_blank\\" rel=\\"noopener\\">Kho dữ liệu mở của World Bank</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://elibrary.worldbank.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76564.jpg\\" alt=\\"World Bank\\" /></a></p>\\n<p><a href=\\"http://www.worldbank.org/elibrary\\" target=\\"_blank\\" rel=\\"noopener\\">Thư viện điện tử của World Bank</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"http://repec.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76565.jpg\\" alt=\\"RePEc\\" /></a></p>\\n<p><a href=\\"http://repec.org/\\" target=\\"_blank\\" rel=\\"noopener\\"><strong>C&aacute;c C&ocirc;ng tr&igrave;nh Nghi&ecirc;n cứu Kinh tế (RePEc)</strong></a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://opus.lib.uts.edu.au/handle/10453/19979\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76566.jpg\\" alt=\\"Australasian Digital Theses Program (ADT)\\" /></a></p>\\n<p><a href=\\"https://opus.lib.uts.edu.au/handle/10453/19979\\" target=\\"_blank\\" rel=\\"noopener\\">CSDL luận &aacute;n sau đại học của Australia</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p class=\\"pBody\\"><a href=\\"https://journals.sagepub.com/home/sgo\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76572.jpg\\" alt=\\"Sage Open\\" /></a></p>\\n<p class=\\"pBody\\"><a href=\\"https://journals.sagepub.com/home/sgo\\" target=\\"_blank\\" rel=\\"noopener\\">Xuất bản phẩm cho truy cập miễn ph&iacute; từ SAGE</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p><a href=\\"https://www.inasp.info/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76573.jpg\\" alt=\\"https://www.inasp.info/\\" /></a></p>\\n<p><a href=\\"https://www.inasp.info/\\" target=\\"_blank\\" rel=\\"noopener\\">Mạng ấn phẩm khoa học quốc tế</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p class=\\"pBody\\"><a href=\\"https://vjol.info.vn/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76574.jpg\\" alt=\\"Tạp ch&iacute; Khoa học Việt Nam trực tuyến - VJOL\\" /></a></p>\\n<p class=\\"pBody\\"><a href=\\"https://vjol.info.vn/\\" target=\\"_blank\\" rel=\\"noopener\\">Tạp ch&iacute; Khoa học Việt Nam trực tuyến - VJOL</a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">&nbsp;</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p class=\\"pBody\\"><a href=\\"https://www.forgottenbooks.com/en\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/76/t76575.jpg\\" alt=\\"Forgotten Books\\" /></a></p>\\n<p class=\\"pBody\\"><a href=\\"https://www.forgottenbooks.com/en\\" target=\\"_blank\\" rel=\\"noopener\\"><strong>Forgotten Books</strong></a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">Forgotten Books l&agrave; một nh&agrave; xuất bản s&aacute;ch c&oacute; trụ sở tại London, chuy&ecirc;n phục hồi c&aacute;c s&aacute;ch cũ. Hiện, Forgotten Books đang cung cấp hơn 1.271.513 đầu s&aacute;ch để đọc trực tuyến hoặc tải xuống dưới dạng s&aacute;ch điện tử&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/gioi-thieu-ve-forgotten-books/64131\\">(xem th&ecirc;m)</a></td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\">\\n<p class=\\"pBody\\"><a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/dang-ky-su-dung-mien-phi-bo-csdl-elibraryusa/64123\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/78/t78412.jpg\\" alt=\\"eLibraryUSA\\" /></a></p>\\n</td>\\n<td style=\\"width: 81.7649%;\\">Bạn sẽ được miễn ph&iacute; sử dụng eLibraryUSA, đ&acirc;y l&agrave; một bộ sưu tập kỹ thuật số với c&aacute;c nguồn th&ocirc;ng tin tin cậy từ Hoa Kỳ bao gồm c&aacute;c tờ b&aacute;o, tạp ch&iacute;, s&aacute;ch, luận văn chất lượng v&agrave; c&aacute;c bộ phim v&agrave; video đoạt giải thưởng.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/dang-ky-su-dung-mien-phi-bo-csdl-elibraryusa/64123\\">(xem th&ecirc;m)</a></td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\"><a href=\\"http://www.ebookslides.com/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/78/t78413.jpg\\" alt=\\"Free Ebooks and slide\\" /></a></td>\\n<td style=\\"width: 81.7649%;\\">Free Ebooks and Slides l&agrave; một cơ sở dữ liệu mở, cung cấp truy cập miễn ph&iacute; đến h&agrave;ng ng&agrave;n ebooks v&agrave; slides b&agrave;i giảng thuộc nhiều lĩnh vực kh&aacute;c nhau như: Kế to&aacute;n, Kiểm to&aacute;n, Kinh doanh, Kinh tế - T&agrave;i ch&iacute;nh, Gi&aacute;o dục, Tiếp thị, T&acirc;m l&yacute; học, X&atilde; hội học, Thuế, Nghi&ecirc;n cứu &ndash; Thống k&ecirc;, Y tế - Sức khỏe,&hellip;&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/khai-thac-csdl-free-ebooks-and-slides/64128\\">(xem th&ecirc;m)</a></td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\"><a href=\\"https://www.pdfdrive.com/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/78/t78414.jpg\\" alt=\\"PDF Drive\\" /></a></td>\\n<td style=\\"width: 81.7649%;\\">\\n<p>PDF Drive l&agrave; một c&ocirc;ng cụ t&igrave;m kiếm PDF trực tuyến cho ph&eacute;p bạn t&igrave;m kiếm, xem trước v&agrave; tải xuống c&aacute;c tệp PDF. Th&ocirc;ng qua việc tự động r&agrave; so&aacute;t tất cả c&aacute;c trang cơ sở dữ liệu điện tử tr&ecirc;n thế giới, PDF Drive lu&ocirc;n được cập nhập những t&agrave;i liệu mới nhất. Hiện tại, c&oacute; hơn 75 triệu s&aacute;ch điện tử, tạp ch&iacute;, b&agrave;i b&aacute;o v&agrave; hơn thế nữa tất cả đều được lập chỉ mục, c&oacute; thể kh&aacute;m ph&aacute; trực tiếp tr&ecirc;n PDF Drive.</p>\\n<p>Với PDF Drive bạn c&oacute; thể truy cập đến h&agrave;ng triệu tệp t&agrave;i liệu thuộc nhiều lĩnh vực kh&aacute;c nhau như: Kinh tế, T&agrave;i ch&iacute;nh, Tiếp thị, L&atilde;nh đạo, Nghề nghiệp, M&ocirc;i trường, Gi&aacute;o dục, M&aacute;y t&iacute;nh, Mạng m&aacute;y t&iacute;nh, C&ocirc;ng nghệ, Nghệ thuật, Kiến tr&uacute;c..&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/pdf-drive-mot-tai-nguyen-mo-pdf-co-the-ban-chua-biet/64132\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\"><a href=\\"https://www.open.edu/openlearn/\\" target=\\"_blank\\" rel=\\"noopener\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/78/t78425.jpg\\" alt=\\"OpenLearn\\" /></a></td>\\n<td style=\\"width: 81.7649%;\\">\\n<p>OpenLearn l&agrave; một nền tảng học tập miễn ph&iacute;, được cung cấp bởi Trường Đại học Mở (The Open University) như một phần trong cam kết của Hiến chương Ho&agrave;ng gia Anh nhằm hỗ trợ cho sự ph&aacute;t triển thịnh vượng của cộng đồng.</p>\\n<p>OpenLearn cung cấp c&aacute;c trải nghiệm học tập miễn ph&iacute; với quy m&ocirc; kh&aacute; lớn, với hơn 1000 kh&oacute;a học ngắn hạn (từ 1 - 100 giờ học) thuộc nhiều lĩnh vực như: Sức khỏe, Thể thao &amp; T&acirc;m l&yacute;; Gi&aacute;o dục &amp; Ph&aacute;t triển; Lịch sử &amp; Nghệ thuật; Ng&ocirc;n ngữ; Tiền tệ &amp; Kinh doanh; M&ocirc;i trường; Khoa học, To&aacute;n học &amp; C&ocirc;ng nghệ; X&atilde; hội, Ph&aacute;p luật &amp; Ch&iacute;nh trị.&nbsp;<a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/openlearn-mot-nen-tang-hoc-tap-mien-phi/64135\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n<tr>\\n<td style=\\"width: 18.2351%;\\"><a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/jstor-nguon-tai-nguyen-nghien-cuu-chat-luong-cao/64139\\"><img class=\\"oImage\\" style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"https://lic.haui.edu.vn//media/78/t78440.jpg\\" alt=\\"JSTOR\\" /></a></td>\\n<td style=\\"width: 81.7649%;\\">\\n<p><a href=\\"https://www.jstor.org/\\">JSTOR&nbsp;</a>l&agrave; viết tắt của Journal Storage, được th&agrave;nh lập năm 1995, đến nay JSTOR đ&atilde; ph&aacute;t triển v&agrave; trở th&agrave;nh một trong những cơ sở dữ liệu tạp ch&iacute; dựa v&agrave;o thu&ecirc; bao nổi tiếng v&agrave; c&oacute; uy t&iacute;n tr&ecirc;n thế giới.</p>\\n<p>Được sử dụng tại hơn 11.000 trường học, đại học v&agrave; học viện tr&ecirc;n khắp c&aacute;c ch&acirc;u lục, c&aacute;c bộ sưu tập trong JSTOR bao gồm c&aacute;c tạp ch&iacute; học thuật được b&igrave;nh duyệt, tạp ch&iacute; văn học uy t&iacute;n, chuy&ecirc;n khảo học thuật, b&aacute;o c&aacute;o nghi&ecirc;n cứu v&agrave; c&aacute;c nguồn ch&iacute;nh từ c&aacute;c bộ sưu tập v&agrave; lưu trữ đặc biệt của thư viện.&nbsp;<strong>JSTOR cung cấp quyền truy cập v&agrave;o hơn 12 triệu b&agrave;i b&aacute;o, s&aacute;ch v&agrave; c&aacute;c nguồn ch&iacute;nh tr&ecirc;n hơn 2000 tạp ch&iacute; học thuật trong 75 lĩnh vực.&nbsp;</strong><a href=\\"https://lic.haui.edu.vn/vn/tin-tuc/jstor-nguon-tai-nguyen-nghien-cuu-chat-luong-cao/64139\\">(xem th&ecirc;m)</a></p>\\n</td>\\n</tr>\\n</tbody>\\n</table>"', '1649493144252_image', 200, 1, '2022-04-08 21:11:12', 'DOVANHAI', '2022-04-12 15:51:43', 'DOVANHAI', True, False),
('43ec1ee5-3c4b-4a4d-a910-86a6c1e37f1b', '8d0fb05d-5ca6-4cf6-adfb-75e50d2a88c5', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Phòng đọc Báo, Tạp chí, Luận Văn, Luận Án, Nghiên cứu khoa học phục vụ trở lại sau khi nâng cấp', 'phong-doc-bao-tap-chi-luan-van-luan-an-nghien-cuu-khoa-hoc-phuc-vu-tro-lai-sau-khi-nang-cap', 'Sau khi được nâng cấp, cải tạo, Phòng đọc Báo, Tạp chí, Luận Văn, Luận Án, N...', '"<p id=\\"l-u-tr-th-ng-tin-c-a-ldap-4\\">Sau khi được n&acirc;ng cấp, cải tạo, Ph&ograve;ng đọc B&aacute;o, Tạp ch&iacute;, Luận Văn, Luận &Aacute;n, Nghi&ecirc;n cứu khoa học đ&atilde; tổ chức phục vụ bạn đọc từ cuối th&aacute;ng 11 năm 2018.&nbsp;</p>\\n<p>Thời gian phục vụ: 8 giờ 15 đến 16 giờ 45 c&aacute;c ng&agrave;y trong tuần (trừ thứ 7 v&agrave; chủ nhật).</p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Fphong%20doc%20tang%206%20-%20GV%201.jpeg?alt=media&token=9b60bc49-d8fd-4105-b207-66daa5e6f2e5', 200, 1, '2022-04-05 14:37:25', 'DOVANHAI', '2022-04-12 15:20:31', 'DOVANHAI', True, False),
('491e159f-838e-4503-b5db-b55aefe84d48', 'ecda97dd-6da9-4eb4-bf32-937d85a351b4', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'DỊCH VỤ MƯỢN TRẢ TÀI LIỆU', 'dich-vu-muon-tra-tai-lieu', 'Là dịch vụ cung cấp tài liệu mượn đọc tại chỗ, tài liệu mượn về nhà cho bạn đọc.', '"<p class=\\"pBody\\">L&agrave; dịch vụ cung cấp t&agrave;i liệu mượn đọc tại chỗ, t&agrave;i liệu mượn về nh&agrave; cho bạn đọc.</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69106.jpg\\" alt=\\"DỊCH VỤ MƯỢN TRẢ T&Agrave;I LIỆU\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>\\n<p class=\\"pBody\\">Hiện tại, tất cả c&aacute;c ph&ograve;ng đọc đều được trang bị hệ thống m&aacute;y t&iacute;nh hỗ trợ bạn đọc tra cứu danh mục t&agrave;i liệu v&agrave; c&aacute;c kho s&aacute;ch được đặt ở trạng th&aacute;i kho mở, bạn đọc c&oacute; thể dễ d&agrave;ng tiếp cận hơn với nguồn t&agrave;i liệu, tự chọn t&agrave;i liệu tr&ecirc;n kệ theo số lượng quy định cho từng đối tượng. C&aacute;n bộ thủ thư thực hiện cho mượn trả tự động với sự hỗ trợ của m&aacute;y qu&eacute;t m&atilde; vạch v&agrave; phần mềm libol 6.0. Thủ tục mượn trả t&agrave;i liệu đơn giản, nhanh gọn tạo cho người d&ugrave;ng tin sự thuận tiện, tiết kiệm được thời gian trong việc mượn, trả t&agrave;i liệu.</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69104.jpg\\" alt=\\"DỊCH VỤ MƯỢN TRẢ T&Agrave;I LIỆU\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>\\n<p class=\\"pBody\\">Sự phối hợp giữa c&ocirc;ng nghệ hiện đại trong hoạt động mượn - trả t&agrave;i liệu gi&uacute;p cho đội ngũ chuy&ecirc;n vi&ecirc;n thư viện chuy&ecirc;n nghiệp; dịch vụ lưu h&agrave;nh t&agrave;i liệu hỗ trợ tối đa khả năng tiếp cận v&agrave; khai th&aacute;c tốt c&aacute;c t&agrave;i nguy&ecirc;n được Nh&agrave; trường trang bị tại Thư viện cho người sử dụng.</p>"', '1649693660869_image', 200, 1, '2022-04-05 16:21:22', 'DOVANHAI', '2022-04-12 15:58:18', 'DOVANHAI', True, False),
('4b5bdcde-4df6-4e85-bce9-cfbe3079ff09', '56feeccd-db4e-449e-94a4-75359904ccca', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Các dịch vụ khác', 'cac-dich-vu-khac', 'Mô tả mặc định', '"<h1>C&aacute;c dịch vụ kh&aacute;c</h1>\\n<p>Ngo&agrave;i c&aacute;c nhiệm vụ ch&iacute;nh được Nh&agrave; trường giao, h&agrave;ng năm Trung t&acirc;m phối hợp c&ugrave;ng với c&aacute;c đơn vị kh&aacute;c trong Nh&agrave; trường tổ chức thực hiện c&aacute;c chương tr&igrave;nh Hội nghị, hội thảo... thực hiện in ấn/photo t&agrave;i liệu, đề thi phục vụ tuyển sinh..</p>\\n<p><strong><a href=\\"https://sites.google.com/view/ml-lic-haui-edu-vn/trang-ch%E1%BB%A7\\">T&Agrave;I LIỆU HỌC TẬP THEO TỪNG NG&Agrave;NH, TỪNG KỲ</a></strong></p>"', '', 200, 1, '2022-04-12 16:00:21', 'DOVANHAI', '2022-04-27 20:28:34', 'DOVANHAI', True, False),
('561da415-cce4-4c87-b53f-8919382aff0a', '913cadf0-020f-4f7e-a5f1-0b4d526c048c', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Các dịch vụ hỗ trợ Học tập/Giảng dạy/Nghiên cứu tại Thư viện Đại học Công nghiệp Hà Nội', 'cac-dich-vu-ho-tro-hoc-tapgiang-daynghien-cuu-tai-thu-vien-dai-hoc-cong-nghiep-ha-noi', 'Mô tả mặc định', '"<p class=\\"pBody\\">L&agrave; c&aacute;c dịch vụ v&agrave; tiện &iacute;ch được tổ chức v&agrave; điều phối nhằm hỗ trợ v&agrave; tăng cường hoạt động học tập, giảng dạy, nghi&ecirc;n cứu cho chương tr&igrave;nh đ&agrave;o tạo ch&iacute;nh thức v&agrave; theo đuổi việc học tập suốt đời của cộng đồng sử dụng Thư viện Trường; hướng tới thỏa m&atilde;n, đ&aacute;p ứng, định hướng nhu cầu học tập, giảng dạy v&agrave; nghi&ecirc;n cứu hiện tại v&agrave; tương lai của cộng đồng sử dụng Thư viện trường. C&aacute;c dịch vụ Hỗ trợ Giảng dạy/Học tập/Nghi&ecirc;n cứu được triển khai tại Thư viện gồm:</p>\\n<p class=\\"pBody\\">Dự trữ t&agrave;i liệu m&ocirc;n học/Sử dụng t&agrave;i liệu m&ocirc;n học</p>\\n<p class=\\"pBody\\">Ph&aacute;t h&agrave;nh/Ph&acirc;n phối t&agrave;i liệu;</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69108.jpg\\" alt=\\"C&aacute;c dịch vụ hỗ trợ Học tập/Giảng dạy/Nghi&ecirc;n cứu tại Thư viện Đại học C&ocirc;ng nghiệp H&agrave; Nội\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>"', '', 200, 1, '2022-04-12 15:59:51', 'DOVANHAI', '2022-04-12 15:59:51', 'DOVANHAI', True, False),
('65ac4f1d-4b66-40e0-845d-036c91f01f2c', '88961a2d-7d75-49fe-8713-ababd8097f2e', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Tài liệu số', 'tai-lieu-so', 'Tài liệu số gồm các tài liệu có bản quyền thuộc sở hữu của Trường đại học Công nghiệp Hà Nội như bài giảng, giáo trình, khóa luận, đ...', '"<p class=\\"pBody\\">T&agrave;i liệu số gồm c&aacute;c t&agrave;i liệu c&oacute; bản quyền thuộc sở hữu của Trường đại học C&ocirc;ng nghiệp H&agrave; Nội như b&agrave;i giảng, gi&aacute;o tr&igrave;nh, kh&oacute;a luận, đồ &aacute;n, luận văn, luận &aacute;n, đề t&agrave;i nghi&ecirc;n cứu khoa học, b&agrave;i b&aacute;o khoa học&hellip;</p>\\n<p class=\\"pBody\\"><em><strong>Điều kiện sử dụng</strong></em></p>\\n<p class=\\"pBody\\">Đối tượng được cấp t&agrave;i khoản truy cập tại phần mềm quản l&yacute; của Thư viện; đăng nhập l&agrave; y&ecirc;u cầu bắt buộc cho việc xem/tải nguồn t&agrave;i liệu số.</p>"', '', 200, 1, '2022-04-12 15:48:56', 'DOVANHAI', '2022-04-12 15:48:56', 'DOVANHAI', True, False),
('6a914602-74de-4610-b0ed-11716ab25593', '1e329a21-6c8d-42a8-8470-a28a3404bd38', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Tài liệu in (giấy)', 'tai-lieu-in-giay', 'Tài liệu dạng in của Thư viện đa dạng các xuất bản phẩm dạng in phục vụ cho việc học tập, giảng dạy, nghiên cứu và giải trí lành mạnh, bao gồm sách, báo...', '"<p class=\\"pBody\\">T&agrave;i liệu dạng in của Thư viện đa dạng c&aacute;c xuất bản phẩm dạng in phục vụ cho việc học tập, giảng dạy, nghi&ecirc;n cứu v&agrave; giải tr&iacute; l&agrave;nh mạnh, bao gồm s&aacute;ch, b&aacute;o, tạp ch&iacute;, kh&oacute;a luận/đồ &aacute;n, luận văn, luận &aacute;n, c&aacute;c sản ph&acirc;m nghi&ecirc;n cứu khoa học,...được bố tr&iacute; theo c&aacute;c đặc điểm chức năng tại tất cả c&aacute;c cơ sở</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69102.jpg\\" alt=\\"T&agrave;i liệu in (giấy)\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>\\n<p class=\\"pBody\\"><strong>C&aacute;ch thức sử dụng:</strong></p>\\n<p class=\\"pBody\\">Bước 1: Tra cứu, định vị v&agrave; x&aacute;c định t&igrave;nh trạng t&agrave;i liệu trong kho</p>\\n<p class=\\"pBody\\">Bước 2: V&agrave;o kho lấy t&agrave;i liệu</p>\\n<p class=\\"pBody\\">Bước 3: Thực hiện thủ tục mượn t&agrave;i liệu (nếu c&oacute;)</p>\\n<p class=\\"pBody\\">Bước 4: Sử dụng t&agrave;i liệu một c&aacute;ch c&oacute; &yacute; thức</p>\\n<p class=\\"pBody\\">Bước 5: Trả t&agrave;i liệu đ&uacute;ng hạn v&agrave; đ&uacute;ng vị tr&iacute; y&ecirc;u cầu</p>\\n<p class=\\"pBody\\"><strong>Điều kiện sử dụng</strong></p>\\n<p class=\\"pBody\\">Đối tượng được cấp quyền sử dụng t&agrave;i liệu thư viện dạng in</p>\\n<p class=\\"pBody\\"><strong>Ch&iacute;nh s&aacute;ch sử dụng</strong></p>\\n<p class=\\"pBody\\">Đọc tại Thư viện v&agrave;/hoặc cho mang ra khỏi Thư viện t&ugrave;y từng t&agrave;i liệu cụ thể</p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Ft69102.jpg?alt=media&token=6c0e12e0-3364-48e8-a5d7-73f190185ace', 200, 1, '2022-04-05 21:23:33', 'DOVANHAI', '2022-04-12 15:48:12', 'DOVANHAI', True, False),
('7e549eaa-51e6-4fc0-b7f0-9ce597b1070d', 'be71f925-721b-4892-9a39-c450ea8ea88d', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'VỀ VIỆC TĂNG GIỜ PHỤC VỤ BẠN ĐỌC TRỞ LẠI ...', 've-viec-tang-gio-phuc-vu-ban-doc-tro-lai', '...', '"<p>Trung t&acirc;m Th&ocirc;ng tin - Thư viện tr&acirc;n trọng k&iacute;nh b&aacute;o tới to&agrave;n thể bạn đọc:<br /><br />Từ ng&agrave;y 21/9/2020, Ph&ograve;ng đọc tầng 6 nh&agrave; A8 mở cửa th&ocirc;ng trưa trở lại, khung giờ từ 8h15 đến 17h45 c&aacute;c ng&agrave;y trong tuần (trừ Thứ 7, Chủ Nhật v&agrave; ng&agrave;y lễ).</p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Ftb.jpg?alt=media&token=cba1abe0-0679-4de4-889f-c1045db03f70', 200, 1, '2022-04-12 08:57:36', 'DOVANHAI', '2022-04-12 15:02:24', 'DOVANHAI', True, False),
('99696a9e-c108-4a15-b086-b71787b2e06d', 'be71f925-721b-4892-9a39-c450ea8ea88d', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'THÔNG BÁO LỊCH NGHỈ LỄ GỖ TỔ HÙNG VƯƠNG VÀ 30/4 - 1/5', 'thong-bao-lich-nghi-le-go-to-hung-vuong-va-304-15', 'Thực hiện kế hoạch nghỉ các ngày Lễ giỗ tổ Hùng Vương, Chiến thắng 30/4 và Quốc tế lao động 01/5/2021 của Trường Đại học Công nghiệp Hà Nội, Trung tâm Thông tin ...', '"<p class=\\"pHead\\">Thực hiện kế hoạch nghỉ c&aacute;c ng&agrave;y Lễ giỗ tổ H&ugrave;ng Vương, Chiến thắng 30/4 v&agrave; Quốc tế lao động 01/5/2021 của Trường Đại học C&ocirc;ng nghiệp H&agrave; Nội, Trung t&acirc;m Th&ocirc;ng tin - Thư viện xin tr&acirc;n trọng th&ocirc;ng b&aacute;o tới bạn đọc thời gian tạm ngưng phục vụ của Trung t&acirc;m như sau:</p>\\n<p>&bull; Ng&agrave;y Giỗ tổ H&ugrave;ng Vương 10/03 &acirc;m lịch (Thứ Tư ng&agrave;y 21/04/2021), Trung t&acirc;m tạm ngưng phục vụ để nghỉ lễ. Từ Thứ Năm ng&agrave;y 22/04/2021, Trung t&acirc;m trở lại phục vụ bạn đọc b&igrave;nh thường.</p>\\n<p>&bull; Ng&agrave;y Giải ph&oacute;ng miền Nam 30/4 v&agrave; Ng&agrave;y Quốc tế Lao động 01/5: Trung t&acirc;m tạm ngưng phục vụ trong 04 ng&agrave;y (từ Thứ S&aacute;u ng&agrave;y 30/04/2021 đến hết Thứ Hai ng&agrave;y 02/05/2021). Từ Thứ Ba ng&agrave;y 03/05/2021, Trung t&acirc;m trở lại phục vụ bạn đọc b&igrave;nh thường.</p>\\n<p>Trung t&acirc;m Th&ocirc;ng tin - Thư viện k&iacute;nh ch&uacute;c bạn đọc c&oacute; một kỳ nghỉ lễ thật vui tươi v&agrave; &yacute; nghĩa b&ecirc;n gia đ&igrave;nh v&agrave; người th&acirc;n.</p>\\n<p>Tr&acirc;n trọng!</p>\\n<div class=\\"irs-courses-img-text\\">\\n<ul class=\\"clearfix\\">\\n<li>\\n<p>Thứ Ba, 15:33 20/04/2022</p>\\n</li>\\n</ul>\\n</div>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Fa76502.jpg?alt=media&token=ec356098-e6de-4762-a7be-6e8c974c9b18', 200, 1, '2022-04-12 15:27:09', 'DOVANHAI', '2022-05-27 23:33:04', 'Đỗ Văn Hải', True, False),
('9af1e5d5-a9f1-4f11-852b-5eba9bac1145', 'be71f925-721b-4892-9a39-c450ea8ea88d', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Tiêu đề bài đăng mặc định 333', 'tieu-de-bai-dang-mac-dinh-333', 'Mô tả mặc định', '"Type some text..."', '', 200, 1, '2022-04-12 15:24:43', 'DOVANHAI', '2022-04-12 15:24:43', 'DOVANHAI', True, True),
('9cec65bb-7170-4a25-ab3f-75c9d72348d9', '8d0fb05d-5ca6-4cf6-adfb-75e50d2a88c5', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Khảo sát ý kiến bạn đọc về chất lượng dịch vụ thư viện năm 2021-2022', 'khao-sat-y-kien-ban-doc-ve-chat-luong-dich-vu-thu-vien-nam-2021-2022', 'Thư viện Trường Đại học Giao thông Vận tải chân thành cảm ơn bạn đọc đã đồng hành cùng chúng tôi trong thời gian qua...', '"<p>K&iacute;nh gửi Qu&yacute; bạn đọc!</p>\\n<p>Thư viện Trường Đại học Giao th&ocirc;ng Vận tải ch&acirc;n th&agrave;nh cảm ơn bạn đọc đ&atilde; đồng h&agrave;nh c&ugrave;ng ch&uacute;ng t&ocirc;i trong thời gian qua. Để n&acirc;ng cao hơn nữa chất lượng phục vụ của Thư viện, ch&uacute;ng t&ocirc;i rất mong nhận được &yacute; kiến đ&aacute;nh gi&aacute; của c&aacute;c bạn về chất lượng dịch vụ của Thư viện, theo phiếu khảo s&aacute;t trong đường link dưới đ&acirc;y.</p>\\n<p><a href=\\"https://forms.gle/AqbHPRj9CXmxVv5LA\\">https://forms.gle/AqbHPRj9CXmxVv5LA</a></p>\\n<p>Tr&acirc;n trọng cảm ơn.</p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Fimg_5d568b2fc9934.png?alt=media&token=34339414-b0b0-4f4c-9229-dbddcaebb1ca', 200, 1, '2022-04-08 21:01:37', 'DOVANHAI', '2022-04-12 15:20:55', 'DOVANHAI', True, False),
('dbe0aa4c-9463-4838-84ce-f23dce5987ed', 'df867bd4-8f77-4418-afa3-5b49bd4270a5', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Pathways 3: Reading, Writing and Critical Thinking', 'pathways-3-reading-writing-and-critical-thinking', 'Presentation skills, including organization, preparation, and delivery techniques, are introduced and practiced in every unit, sharpening learners’ ...', '"<p class=\\"pHead\\"><strong>Presentation skills, including organization, preparation, and delivery techniques, are introduced and practiced in every unit, sharpening learners&rsquo; ability to interact in different academic settings. Opportunities for critical thinking throughout each unit prepare learners to succeed in the academic classroom while communication skills are taught and practiced through realistic contexts.</strong></p>\\n<h1>Pathways 3: Reading, Writing and Critical Thinking</h1>\\n<h2>Mari Vargo</h2>\\n<h2>Heinle Cengage Learning</h2>\\n<p>2014</p>\\n<h2>Abstract</h2>\\n<p>Pathways is National Geographic Learning''s new five-level academic skills series that features reading &amp; writing and listening &amp; speaking strands to help learners develop the language skills needed to achieve academic success. Learners develop academic literacy skills through content, images and video from National Geographic. This innovative series provides learners with a pathway to success! With Pathways learners: DEVELOP academic literacy skills CONNECT to the real world through content from National Geographic ACHIEVE academic success.</p>\\n<p>(<a href=\\"https://www.amazon.com/\\">https://www.amazon.com/</a>)</p>\\n<p>Content:</p>\\n<ul>\\n<li>Social Relationships</li>\\n<li>Science and Detection</li>\\n<li>City Solutions</li>\\n<li>Danger Zones</li>\\n<li>The Business of Tourism</li>\\n<li>Landscape and Imagination</li>\\n<li>Global Appetites</li>\\n<li>Medical Innovators</li>\\n<li>Word Languages</li>\\n<li>Survival Instict</li>\\n</ul>\\n<h2>Citation</h2>\\n<p>Mari Vargo. Pathways 3: Reading, Writing and Critical Thinking. Heinle Cengage Learning, 2014.</p>\\n<h2>Collection</h2>\\n<p><a href=\\"https://lic.haui.edu.vn/vn/html/bo-suu-tap/835\\">Ng&agrave;nh NG&Ocirc;N NGỮ ANH (7220201)</a></p>\\n<h2><a href=\\"http://lib.haui.edu.vn/opac80/EDetail.aspx?id=5026&amp;f=fulltext&amp;v=pathways\\">Related document</a></h2>\\n<table border=\\"1\\" cellspacing=\\"1\\" cellpadding=\\"1\\">\\n<tbody>\\n<tr>\\n<td><a href=\\"http://lib.haui.edu.vn/opac80/EDetail.aspx?id=5026&amp;f=fulltext&amp;v=pathways\\"><img class=\\"oImage\\" src=\\"https://lic.haui.edu.vn//media/80/t80655.jpg\\" alt=\\" Pathways 3: Reading, Writing and Critical Thinking\\" /></a></td>\\n<td><a href=\\"https://lic.haui.edu.vn/vn/gioi-thieu-sach-moi/pathways-1-reading-writing-and-critical-thinking/66885\\"><img class=\\"oImage\\" src=\\"https://lic.haui.edu.vn//media/80/t80196.jpg\\" alt=\\"Pathways 1 Reading, Writing and Critical Thinking\\" /></a></td>\\n<td><a href=\\"https://lic.haui.edu.vn/vn/gioi-thieu-sach-moi/pathways-2-listening-and-speaking-and-critical-thingking/64762\\"><img class=\\"oImage\\" src=\\"https://lic.haui.edu.vn//media/79/t79923.jpg\\" alt=\\"Pathways 2 &ndash; listening and speaking and Critical Thingking\\" /></a></td>\\n</tr>\\n<tr>\\n<td>\\n<table>\\n<tbody>\\n<tr>\\n<td><a href=\\"http://lib.haui.edu.vn/opac80/EDetail.aspx?id=5026&amp;f=fulltext&amp;v=pathways\\">Pathways 3: Reading, Writing and Critical Thinking</a></td>\\n</tr>\\n</tbody>\\n</table>\\n</td>\\n<td><a href=\\"https://lic.haui.edu.vn/vn/gioi-thieu-sach-moi/pathways-1-reading-writing-and-critical-thinking/66885\\">Pathways 1 Reading, Writing and Critical Thinking</a></td>\\n<td><a href=\\"https://lic.haui.edu.vn/vn/gioi-thieu-sach-moi/pathways-2-listening-and-speaking-and-critical-thingking/64762\\">Pathways 2 &ndash; listening and speaking and Critical Thingking</a></td>\\n</tr>\\n</tbody>\\n</table>\\n<h2><a href=\\"http://lib.haui.edu.vn/opac80/EDetail.aspx?id=5026&amp;f=fulltext&amp;v=pathways\\">QR code</a></h2>\\n<p><a href=\\"http://lib.haui.edu.vn/opac80/EDetail.aspx?id=5026&amp;f=fulltext&amp;v=pathways\\"><img class=\\"oImage\\" src=\\"https://lic.haui.edu.vn//media/80/t80656.jpg\\" alt=\\"Pathways 3: Reading, Writing and Critical Thinking\\" /></a></p>"', 'https://firebasestorage.googleapis.com/v0/b/fir-library-upload.appspot.com/o/images%2Ft80655.jpg?alt=media&token=10b2425a-85e9-445f-aa4f-eb5b0f0e8f81', 200, 1, '2022-04-12 15:36:18', 'DOVANHAI', '2022-04-12 15:36:18', 'DOVANHAI', True, False),
('e4da603a-6f69-4525-9200-dcf75c708e78', 'd18fd493-c8f4-478a-8531-11e674a148f2', '58d54d4e-b205-4ed8-b0a0-0eaff587c50e', 'Cung cấp không gian và tiện ích', 'cung-cap-khong-gian-va-tien-ich', 'Thư viện Đại học Công nghiệp Hà Nội gồm 03 cơ sở, có tổng diện tích hơn 6000m2, ...', '"<p class=\\"pBody\\">Thư viện Đại học C&ocirc;ng nghiệp H&agrave; Nội gồm 03 cơ sở, c&oacute; tổng diện t&iacute;ch hơn 6000m2, với hệ thống c&aacute;c ph&ograve;ng chức năng đa dạng, được bố tr&iacute; theo hướng mở, thuận tiện cho bạn đọc được trang bị đầy đủ s&aacute;ch, gi&aacute;o tr&igrave;nh, t&agrave;i liệu tham khảo bằng tiếng Việt v&agrave; tiếng nước ngo&agrave;i cho tất cả c&aacute;c đối tượng bạn đọc.</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69103.jpg\\" alt=\\"Cung cấp kh&ocirc;ng gian v&agrave; tiện &iacute;ch\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>\\n<p class=\\"pBody\\">Trung t&acirc;m hiện đang cung cấp 08 ph&ograve;ng học nh&oacute;m, hội thảo v&agrave; 01 ph&ograve;ng m&aacute;y t&iacute;nh được kết nối internet với 40 m&aacute;y phục vụ cho c&ocirc;ng t&aacute;c đ&agrave;o tạo. Ngo&agrave;i ra, c&oacute; tr&ecirc;n 200 m&aacute;y t&iacute;nh được bố tr&iacute; tại c&aacute;c ph&ograve;ng đọc phục vụ bạn đọc đến học tập v&agrave; nghi&ecirc;n cứu.</p>\\n<p class=\\"pBody\\"><img class=\\"oImage\\" src=\\"https://www.haui.edu.vn/media/69/t69105.jpg\\" alt=\\"Cung cấp kh&ocirc;ng gian v&agrave; tiện &iacute;ch\\" align=\\"Middle\\" border=\\"0\\" hspace=\\"0\\" vspace=\\"0\\" /></p>"', '', 200, 1, '2022-04-12 15:59:10', 'DOVANHAI', '2022-04-12 15:59:10', 'DOVANHAI', True, False);

